import React from "react";

const Footer = () => {
  return (
    <footer className="footer">
      <p>
        &copy; 2010 RkEnterprise. All rights reserved. | Premium Interior Design
        Solutions in Delhi
      </p>
      <p>Owner: Ramkishan Sharma | Developed by LOKESH SHARMA</p>
    </footer>
  );
};

export default Footer;
